import React, { Component } from 'react';
import './App.css';
import CardLists from './CardLists';
import {robots} from './robots.js'
import Searchbox from './searchbox';

class App extends Component{
  render(){
    return(
      <div>
        <Searchbox />
        <CardLists robot={robots}/>
      </div>

    );
  }
}

export default App;
